prediction.sparql:
PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX orkgc: <http://orkg.org/orkg/class/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?c ?label WHERE {
  ?c a orkgc:Contribution ; rdfs:label ?label .
  FILTER EXISTS {
    ?c orkgp:P45096 <http://orkg.org/orkg/resource/R124060>
  }
}

PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX orkgc: <http://orkg.org/orkg/class/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?c ?label WHERE {
  ?c a orkgc:Contribution ; orkgp:HAS_DATASET <http://orkg.org/orkg/resource/R123346> .
  OPTIONAL {
    ?c rdfs:label ?label
  }
  FILTER ( LANGMATCHES( LANG( ?label ) , 'en' ) )
}

PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX rdf: <http://www.w3.org/1999/02/22-rdf-syntax-ns#>
PREFIX orkgc: <http://orkg.org/orkg/class/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?contribution ?label ?source_code WHERE {
  ?contribution rdf:type orkgc:Contribution .
  ?contribution rdfs:label ?label .
  FILTER ( regex( ?label , "Longformer" , "i" ) ) .
  OPTIONAL {
    ?contribution orkgp:HAS_SOURCE_CODE ?source_code
  }
  OPTIONAL {
    ?contribution orkgp:P4077 ?source_code
  }
  OPTIONAL {
    ?contribution orkgp:P49000 ?source_code
  }
  OPTIONAL {
    ?contribution orkgp:P16033 ?source_code
  }
  FILTER ( isLiteral( ?source_code ) )
}

PREFIX orkgp: <http://orkg.org/orkg/predicate/>
SELECT ?contribution ?model WHERE {
  ?contribution orkgp:HAS_BENCHMARK <http://orkg.org/orkg/resource/R129713> .
  ?contribution orkgp:HAS_MODEL ?model
}

PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?contribution ?model ?modelLabel WHERE {
  VALUES ?benchmark {
    <http://orkg.org/orkg/resource/R131208> <http://orkg.org/orkg/resource/R131903> <http://orkg.org/orkg/resource/R132006> <http://orkg.org/orkg/resource/R132107> <http://orkg.org/orkg/resource/R132208> <http://orkg.org/orkg/resource/R132307> <http://orkg.org/orkg/resource/R132387> <http://orkg.org/orkg/resource/R132426> <http://orkg.org/orkg/resource/R132525> <http://orkg.org/orkg/resource/R132630> <http://orkg.org/orkg/resource/R132729> <http://orkg.org/orkg/resource/R132834> <http://orkg.org/orkg/resource/R132937> <http://orkg.org/orkg/resource/R133042> <http://orkg.org/orkg/resource/R133145> <http://orkg.org/orkg/resource/R133249> <http://orkg.org/orkg/resource/R133354> <http://orkg.org/orkg/resource/R133459> <http://orkg.org/orkg/resource/R133564> <http://orkg.org/orkg/resource/R133669> <http://orkg.org/orkg/resource/R133731> <http://orkg.org/orkg/resource/R133847> <http://orkg.org/orkg/resource/R133961> <http://orkg.org/orkg/resource/R134096> <http://orkg.org/orkg/resource/R134140>
  }
  .
  ?contribution orkgp:HAS_BENCHMARK ?benchmark .
  ?contribution orkgp:HAS_MODEL ?model .
  OPTIONAL {
    ?model rdfs:label ?modelLabel
  }
}

PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT ?contribution ?label ?abstract WHERE {
  ?contribution rdfs:label ?label .
  FILTER ( CONTAINS( LCASE( ?label ) , "see" ) ) OPTIONAL {
    ?contribution orkgp:P37015 ?abstract .
  }
}
LIMIT 10

