PREFIX orkgp: <http://orkg.org/orkg/predicate/>
PREFIX orkgc: <http://orkg.org/orkg/class/>
PREFIX rdfs: <http://www.w3.org/2000/01/rdf-schema#>
SELECT DISTINCT ?contribution ?label WHERE {
  ?contribution a orkgc:Contribution .
  OPTIONAL {
    ?contribution rdfs:label ?label
  }
  .
  {
    ?contribution orkgp:HAS_DATASET ?ds .
    FILTER ( CONTAINS( LCASE( ?ds ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:P2005 ?ds .
    FILTER ( CONTAINS( LCASE( ?ds ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:P9001 ?ds .
    FILTER ( CONTAINS( LCASE( ?ds ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:P25063 ?ds .
    FILTER ( CONTAINS( LCASE( ?ds ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:P37015 ?abstract .
    FILTER ( CONTAINS( LCASE( ?abstract ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:RESULT ?res .
    FILTER ( CONTAINS( LCASE( ?res ) , 'dcase' ) )
  } UNION {
    ?contribution orkgp:METHOD ?meth .
    FILTER ( CONTAINS( LCASE( ?meth ) , 'dcase' ) )
  }
}

